    return (
        <>
            <Card className='mt-4'>
                            <Link to={link}>
                                <div className="nft_img_div">
                                    <Card.Img src={image} />
                                </div>
            
                                <div>
                                    <Card.Body>
                                       <div className="nft_main_div">
                                       <div className="nft_left_div">
                                            <div className="category_name">fjlksdf</div>
                                            <div className="nft_name"><h6>{name}</h6></div>
                                        </div>
                                        <div className="nft_right_div">
                                            <div className="price_text">Price</div>
                                            <div className="nft_price"><img src={ethereum} alt="img" className='img-fluid mr-1' /><strong>{price}</strong></div>
                                            <div className="nft_auction_time">
                                               
                                            </div>
                                        </div>
                                       </div>
                                    </Card.Body>
                                </div>
                            </Link>
                        </Card>
           
        </>


    )
}

export default ProductCard
